import TextField from "./TextField"

const QuestionOne = () => {
    return ( 
    <form>
        <div>
            <label>Age:</label>
            <TextField type="number"/>
        </div>
        
        <TextField type="text"/>
    </form>
     );
}
 
export default QuestionOne;
